import { FaFacebook } from "react-icons/fa";

const Footer = () => {
  return (
    <>
      <div>
        <div>
          <h1>LOCATION</h1>
          <p>2215 John Daniel Drive</p>
          <p>Clark, MO 65243</p>
        </div>
        <div>
          <h1>AROUND THE WEB</h1>
        </div>
        <div>
          <h1>ABOUT FREELANCER</h1>
          <p>
            Freelance is a free to use, MIT licensed Bootstrap theme created by
            <a>Start Bootstrap</a>.
          </p>
        </div>
      </div>
    </>
  );
};

export default Footer;
